import React from "react";
import { Box } from "@material-ui/core";

function DashboardIcon() {
    return (
        <Box className="icon">
            <Box 
            sx={{
                height: '30px',
                width: '30px'
            }}
            component='img'
            src='/vectors/grid.png'
            alt='dashboard_logo'
            />
            <p >Dashboard</p>
        </Box>

    )
}

export default DashboardIcon;
